import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import './App.css';
import WeatherAPI from './WeatherAPI';
import axios from 'axios'; // For React (assuming you're using a bundler like webpack)

function App() {

    const [weather, setWeather] = useState([]);

    const [zipCode, setZipCode] = useState('');
    const [coordinates, setCoordinates] = useState(null);
    const [error, setError] = useState(null);

    const handleInputChange = (event) => {
        setZipCode(event.target.value);
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        try {
            const apiKey = 'YOUR_GOOGLE_API_KEY'; // Replace with your own API key
            const url = `https://maps.googleapis.com/maps/api/geocode/json?address=${zipCode}&key=${apiKey}`;

            const response = await axios.get(url);
            const { results } = response.data;

            if (results.length > 0) {
                const { lat, lng } = results[0].geometry.location;
                setCoordinates({ latitude: lat, longitude: lng });
                setError(null);
            } else {
                throw new Error('Unable to find coordinates for the provided zip code.');
            }
        } catch (error) {
            setCoordinates(null);
            setError(error.message);
        }
    };

  return (
    <div>
        <Router>
            <Routes>
                <Route path="/" element={
                    <Weather
                        weather = {weather}
                        setWeather = {setWeather}
                    />}/>
                <Route path="/favorites" element={<Favorites />}/>
                <Route path="/popular" element={<Popular />}/>
            </Routes>
        </Router>
    </div>
  );
}

function Nav() {
    return (
        <ul id='nav'>
            <li><Link to="/">Weather</Link></li>
            <li><Link to="/favorites">Favorites</Link></li>
            <li><Link to="/popular">Popular</Link></li>
        </ul>
    );
}

function Header() {
    return (
        <div className='App'>
            <h2>Weather App</h2>
            <Nav />
        </div>
    );
}


function Weather(props) {
    const [city, setCity] = useState('');
    const [temperature, setTemperature] = useState('');
    const [weather, setWeather] = useState('');

    const handleFormSubmit = (e) => {
        e.preventDefault();
        const cityWeather = props.weather.find((data) => data.city === city);
        if (cityWeather) {
            setTemperature(cityWeather.TempF);
            setWeather(cityWeather.Weather);
        } else {
            setTemperature('');
            setWeather('');
        }
        setCity('');
    };

    return (
        <div className="app-center">
            <Header />
            <form onSubmit={handleFormSubmit}>
                <input
                    type="text"
                    value={city}
                    onChange={(e) => setCity(e.target.value)}
                    placeholder="Enter Zip code"
                />
                <button type="submit">Get Weather</button>
            </form>
            <p>City: {city}</p>
            <p>Temperature: {temperature}</p>
            <p>Weather: {weather}</p>
        </div>
    )
}


function Favorites() {
    return (
        <div className="app-center">
            <Header />
            <h3>Favorites</h3>


        </div>
    )
}


function Popular() {
    return (
        <div className="app-center">
            <Header />
            <h3>Popular Locations</h3>


        </div>
    )
}


export default App;
